import React from 'react';
import s from './Home.module.css'
import CoffeeItem from "../../components/coffeeItem/CoffeeItem";
import coffee1 from '../../img/coffee1.jpg'
import coffee2 from '../../img/coffee2.jpg'
import coffee3 from '../../img/coffee3.jpg'
import coffee4 from '../../img/coffee4.jpg'
import coffee5 from '../../img/coffee5.jpg'
import coffee6 from '../../img/coffee6.jpg'
import {NavLink} from "react-router-dom";

const Home = () => {

    let coffees = [
        {
            img: coffee1,
            name: 'Latte',
            price: 50,
            volumeInMl: 250
        },
        {
            img: coffee2,
            name: 'Americano',
            price: 50,
            volumeInMl: 250
        },
        {
            img: coffee3,
            name: 'Cacao',
            price: 50,
            volumeInMl: 250
        },
        {
            img: coffee4,
            name: 'Iced Caramel Macchiato',
            price: 50,
            volumeInMl: 250
        },
        {
            img: coffee5,
            name: 'Mocha',
            price: 50,
            volumeInMl: 250
        },
        {
            img: coffee6,
            name: 'Coffee',
            price: 50,
            volumeInMl: 250
        },

    ]

    return (
        <div>
            <div className={s.hero}>
                <div className={s.container}>
                    <div className={s.contacts}>
                        <span><a href="">Зареєструйтесь</a> та знижка від 3% ваша</span>
                    </div>
                    <div className={s.home_text}>
                        <p className={s.p}>
                            Lorem Ipsum is simply dummy text of
                            the printing and typesetting industry. Lorem Ipsum has been
                        </p>
                    </div>
                </div>
            </div>
            <div>
                <div className={s.container}>

                    <div className={s.items}>
                        {
                            coffees.map(((item) => (
                                <CoffeeItem image={item.img} name={item.name} price={item.price}
                                            volumeInMl={item.volumeInMl}/>)))
                        }
                    </div>

                    <NavLink>
                        <button>Show more</button>
                    </NavLink>

                </div>
            </div>
        </div>
    );
};

export default Home;
